*/
export function percentsToTime(percent) {
	//проценты это шаги по 15 минут, 1 процент - 15 минут
	const minutes = percent * 15;

	const milisecondsPerMinutes = 1000 * 60 * minutes;
	//convert Thu, 01 Jan 1970 12:00:00 GMT
